CREATE TABLE public.buyinggroup (
    buyinggroupid integer NOT NULL,
    buyinggroupname text NOT NULL
);

CREATE TABLE public.buyinggroupdeal (
    buyinggroupid integer NOT NULL,
    dealid integer NOT NULL
);

CREATE TABLE public.buyinggroupmembership (
    customerid integer NOT NULL,
    buyinggroupid integer NOT NULL
);

CREATE TABLE public.customer (
    customerid integer NOT NULL,
    customername text NOT NULL,
    defaultbilltocustomerid integer NOT NULL,
    primarycontactpersonid integer NOT NULL,
    creditlimit real,
    isoncredithold integer DEFAULT 0 NOT NULL,
    paymentdays integer DEFAULT 30 NOT NULL,
    CONSTRAINT customer_creditlimit_check CHECK ((creditlimit > (0)::double precision)),
    CONSTRAINT customer_isoncredithold_check CHECK (((isoncredithold = 0) OR (isoncredithold = 1))),
    CONSTRAINT customer_paymentdays_check CHECK ((paymentdays > 0))
);

CREATE TABLE public.customercategory (
    customercategoryid integer NOT NULL,
    customercategoryname text NOT NULL
);

CREATE TABLE public.customercategorydeal (
    customercategoryid integer NOT NULL,
    dealid integer NOT NULL
);

CREATE TABLE public.customercategorymembership (
    customerid integer NOT NULL,
    customercategoryid integer NOT NULL
);

CREATE TABLE public.customerdeal (
    customerid integer NOT NULL,
    dealid integer NOT NULL
);

CREATE TABLE public.deal (
    dealid integer NOT NULL,
    stockgroupid integer,
    percent real DEFAULT 0.1 NOT NULL,
    CONSTRAINT deal_percent_check CHECK (((percent > (0)::double precision) AND (percent < (1)::double precision)))
);

CREATE TABLE public.deliverymethod (
    deliverymethodid integer NOT NULL,
    deliverymethodname text
);

CREATE TABLE public.invoiceheader_2013_partial (
    invoiceid integer NOT NULL,
    invoicedate date NOT NULL,
    billtocustomerid integer NOT NULL,
    invoicelocationid integer NOT NULL
);

CREATE TABLE public.invoiceline_2013_partial (
    orderid integer NOT NULL,
    stockitemid integer NOT NULL,
    invoiceid integer NOT NULL,
    quantity integer NOT NULL,
    unitprice real NOT NULL,
    taxrate real,
    deliverymethodid integer NOT NULL,
    confirmeddeliverydate date,
    CONSTRAINT invoiceline_quantity_check CHECK ((quantity > 0)),
    CONSTRAINT invoiceline_taxrate_check CHECK ((taxrate > (0)::double precision)),
    CONSTRAINT invoiceline_unitprice_check CHECK ((unitprice > (0)::double precision))
);

CREATE TABLE public.location (
    locationid integer NOT NULL,
    streetaddressline1 text NOT NULL,
    streetaddressline2 text,
    city text NOT NULL,
    state text NOT NULL,
    zip text NOT NULL,
    customerid integer NOT NULL
);

CREATE TABLE public.payment (
    paymentid integer NOT NULL,
    customerid integer NOT NULL,
    paymentamount real NOT NULL,
    paymentdate date NOT NULL,
    CONSTRAINT payment_paymentamount_check CHECK ((paymentamount < (0)::double precision))
);

CREATE TABLE public.purchaseorderheader (
    purchaseorderid integer NOT NULL,
    supplierid integer NOT NULL,
    orderdate date NOT NULL
);

CREATE TABLE public.purchaseorderline (
    purchaseorderid integer NOT NULL,
    stockitemid integer NOT NULL,
    orderedouters integer NOT NULL,
    expectedouterunitprice real NOT NULL,
    expecteddeliverydate date NOT NULL,
    CONSTRAINT purchaseorderline_expectedouterunitprice_check CHECK ((expectedouterunitprice > (0)::double precision)),
    CONSTRAINT purchaseorderline_orderedouters_check CHECK ((orderedouters > 0))
);

CREATE TABLE public.receivingreportheader (
    receivingreportid integer NOT NULL,
    purchaseorderid integer NOT NULL,
    receivingdate date NOT NULL,
    invoiceid integer
);

CREATE TABLE public.receivingreportline (
    stockitemid integer NOT NULL,
    purchaseorderid integer NOT NULL,
    receivingreportid integer NOT NULL,
    receivedouters integer NOT NULL,
    CONSTRAINT receivingreportline_receivedouters_check CHECK ((receivedouters > 0))
);

CREATE TABLE public.salesorderheader (
    orderid integer NOT NULL,
    backorderid integer,
    salespersonpersonid integer NOT NULL,
    orderdate date NOT NULL,
    customerid integer NOT NULL,
    shippinglocationid integer,
    expecteddeliverydate date NOT NULL,
    customerpo text,
    pickedbypersonid integer,
    invoiceid integer
);

CREATE TABLE public.salesorderline (
    orderid integer NOT NULL,
    stockitemid integer NOT NULL,
    quantity integer NOT NULL,
    unitprice real NOT NULL,
    taxrate real,
    CONSTRAINT orderline_quantity_check CHECK ((quantity > 0)),
    CONSTRAINT orderline_taxrate_check CHECK ((taxrate > (0)::double precision)),
    CONSTRAINT orderline_unitprice_check CHECK ((unitprice > (0)::double precision))
);

CREATE TABLE public.supplier (
    supplierid integer NOT NULL,
    suppliername text NOT NULL,
    phonenumber text NOT NULL
);

CREATE TABLE public.suppliercategory (
    suppliercategoryid integer NOT NULL,
    suppliercategoryname text NOT NULL
);

CREATE TABLE public.suppliercategorymembership (
    supplierid integer NOT NULL,
    suppliercategoryid integer NOT NULL
);


CREATE TABLE public.supplierinvoice (
    invoiceid integer NOT NULL,
    supplierinvoicenumber integer NOT NULL,
    invoicedate date NOT NULL,
    invoiceamount real NOT NULL,
    taxamount real NOT NULL,
    supplierid integer NOT NULL,
    CONSTRAINT invoice_invoiceamount_check CHECK ((invoiceamount > (0)::double precision)),
    CONSTRAINT invoice_taxamount_check CHECK ((taxamount > (0)::double precision))
);

CREATE TABLE public.supplierlocation (
    locationid integer NOT NULL,
    supplierid integer NOT NULL,
    shippingaddressline1 text,
    shippingaddressline2 text NOT NULL,
    shippingcity text NOT NULL,
    shippingstate text NOT NULL,
    shippingzip text NOT NULL,
    addresstype text NOT NULL
);

CREATE TABLE public.supplierpayment (
    supplierpaymentid integer NOT NULL,
    supplierid integer NOT NULL,
    paymentamount real NOT NULL,
    paymentdate date NOT NULL
);


  





	
















